"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1449","type":"NoOverlap"},{"attributes":{},"id":"1454","type":"CategoricalTickFormatter"},{"attributes":{"dimensions":"width"},"id":"1388","type":"WheelZoomTool"},{"attributes":{"tools":[{"id":"1234"},{"id":"1235"},{"id":"1236"}]},"id":"1237","type":"Toolbar"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1394","type":"Line"},{"attributes":{},"id":"1118","type":"LinearScale"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1242","type":"Line"},{"attributes":{},"id":"1447","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1059","type":"ResetTool"},{"attributes":{"tools":[{"id":"1386"},{"id":"1387"},{"id":"1388"}]},"id":"1389","type":"Toolbar"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1395","type":"Line"},{"attributes":{"child":{"id":"1039"},"
